cy.request({
  method: "POST",
  url: "http://atlasdev.eastus2.cloudapp.azure.com/api/v1/user/login",
  failOnStatusCode: false,
  body: {
    username: "admin9999",
    password: "wrongpassword",
    rememberMe: false
  }
}).then(response => {
  let datos;
  datos = JSON.parse(JSON.stringify(response.body)); //console.log(datos);
  expect(datos.StatusCode).to.be.equal(400);
  expect(datos.Detail).to.be.equal("Invalid login attempt.");
  expect(datos.Message).to.be.equal("*User Service*. Invalid Request Exception");
});
